import styles from './FieldSet.module.scss';
import { Input } from '@material-ui/core';
const FieldSet = () =>{
    return(
        <div className='MuiInput-formControl'>
            <label htmlFor='title'>Tiêu đề</label>
            <Input type='text' id='title'/>
        </div>
    )
}

export default FieldSet;
